import React, { Component } from 'react';
import {
  Grid,
  Row,
  Col,
  Button,
  OverlayTrigger,
  Popover,
} from 'react-bootstrap';
import './App.css';
import TsModal from'./tsmodal';

class Timeslots extends Component {
  constructor(props, context) {
    super(props, context);

    this.handleShow = this.handleShow.bind(this);
    this.handleClose = this.handleClose.bind(this);
    this.handleButPush = this.handleButPush.bind(this);
    this.colhour = this.colhour.bind(this);
    this.state = {
      show: false, 
      buttonPush: 'invalid',
      list : [],  
      popoverlist : [ {'10:00-10:30' : [{p1: "Available", p2:"Available", s1:"Available", s2:"Available", s3:"Available"}] } ,
                      {'10:30-11:00' : {p1: "Available", p2:"Available", s1:"Available", s2:"Available", s3:"Available"} }]
    };
  }

  componentDidMount() {
    this.getList();
  }

  getList = () => {
    fetch("/purchase")
    .then( (res) => res.json())   
    .then( (json) => {this.setState({list: json});});
  }

  handleClose() {
    this.setState({ show: false });
  }

  handleShow() {
    this.setState({ show: true });
  }
  handleButPush(val) {
    this.setState({ buttonpush: val });
  }

  handlePopoverList(keeptime,butdisable) {
    const newList = this.state.popoverlist.slice();
    if(keeptime === butdisable[0]) {
       if(butdisable[1] === 'Pool Table 1') {
        newList[0].status = "Booked";
       }
       else if(butdisable[1] === 'Pool Table 2') {
        newList[1].status = "Booked";

       }
       else if(butdisable[1] === 'Snooker Table 1') {
        newList[2].status = "Booked";

       }
       else if(butdisable[1] === 'Snooker Table 2') {
        newList[3].status = "Booked";

       }
       else if(butdisable[1] === 'Snooker Table 3') {
        newList[4].status = "Booked";
       }

       this.setState({popoverlist : newList});
    }
  }

  popoverHoverFocus(keeptime) {
    var ts = keeptime;
