  return(
  <Popover id="popover-trigger-hover-focus" title="Table status">
    <strong >P1 -> {this.state.popoverlist.ts.p1}</strong> <br />
    <strong >P2 -> {this.state.popoverlist[1].status}</strong> <br />
    <strong >S1 -> {this.state.popoverlist[2].status}</strong> <br />
    <strong >S2 -> {this.state.popoverlist[3].status}</strong> <br />
    <strong >S3 -> {this.state.popoverlist[4].status}</strong> <br />
  </Popover>
  );
  } 


  colhour(keeptime,butdisable) {
    return(  
        <Col className='halfhour' xs={4} md={1}>
          <TsModal modalid = {this.state.buttonpush} show={this.state.show} onhide={this.handleClose} onclick={this.handleClose} />
            <OverlayTrigger overlay = {this.popoverHoverFocus(keeptime)}>
              <Button bsStyle="primary" bsSize="small" onMouseEnter={() => {this.handlePopoverList(keeptime, butdisable);}} onClick={() => { this.handleShow(); this.handleButPush({keeptime}); }}>
                {keeptime} 
              </Button>
            </OverlayTrigger>
        </Col>
    );
  }

  render() { 
